// import DestinationsContainer from '../containers/DestinationsList'



const DestinationsList = (props) => {
   // console.log(props)

    return (
        <div>
            {props.destinations.map(dest => <li key={dest.id}> {dest.name} <br></br> - City:{dest.city} <br></br> - {dest.state} <br></br> - {dest.description}</li>)}
        </div>
    )
}

export default DestinationsList
